import Login from "./pages/login/Login.jsx"
import Home from "./pages/home/Home.jsx"
import './App.css';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/home",
    element: <Home/>,
  },
]);

function App() {
  return (
    <div className="App">
      <Login/>
    </div>
  );
}

export default App;
